 predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"21367","type":"Paragraph"},{"attributes":{"data_source":{"id":"21256"},"glyph":{"id":"21257"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"21258"},"selection_glyph":null,"view":{"id":"21260"}},"id":"21259","type":"GlyphRenderer"},{"attributes":{"ticks":[1582675200000.0,1583280000000.0,1583884800000.0,1584489600000.0,1585094400000.0,1585699200000.0,1586304000000.0,1586908800000.0,1587513600000.0,1588118400000.0,1588723200000.0,1589328000000.0,1589932800000.0,1590537600000.0,1591142400000.0]},"id":"21254","type":"FixedTicker"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"21251","type":"Line"},{"attributes":{"line_alpha":0.6,"line_color":"#3288bd","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"21250","type":"Line"},{"attributes":{"source":{"id":"21249"}},"id":"21253","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"21258","type":"Circle"},{"attributes":{"text":"Evolu\u00e7\u00e3o do Fator de Crescimento no Estado de Rond\u00f4nia"},"id":"21264","type":"Title"},{"attributes":{"fill_color":{"value":"white"},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":2},"x":{"field":"x"},"y":{"field":"y"}},"id":"21257","type":"Circle"},{"attributes":{"data":{"x":{"__ndarray__":"AACAsOwHd0IAAEAWPwh3QgAAAHyRCHdCAADA4eMId0IAAIBHNgl3QgAAQK2ICXdCAAAAE9sJd0IAAMB4LQp3QgAAgN5/CndCAABARNIKd0IAAACqJA
